// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC1155/utils/ERC1155Receiver.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";
import "../NFT/ICrownNFT.sol";
import "../NFT/IScepterNFT.sol";

contract MarketStore is ERC1155Receiver, IERC721Receiver {
    using Counters for Counters.Counter;
    Counters.Counter private _itemIds;

    address _DAOTreasury = 0xd2a859A8F31f811B962556E0730c3E7Bf45A7Ed2;
    address _owner;
    ICrownNFT CrownNFTContract;
    IScepterNFT ScepterNFTContract;

    constructor() {
        _owner = msg.sender;
    }

    struct MarketItem {
        uint256 itemId;
        uint256 tokenId;
        address payable seller;
        uint256 price;
        uint256 quantity;
    }

    mapping(uint256 => MarketItem) private idToMarketItem;

    event MarketItemCreated(
        uint256 indexed itemId,
        uint256 indexed tokenId,
        address seller,
        uint256 price,
        uint256 quantity
    );

    event BuyMarketItem(
        uint256 indexed itemId,
        uint256 indexed tokenId,
        uint256 quantity,
        uint256 price,
        address seller,
        address buyer
    );

    event WithdrawItem(
        uint256 indexed itemId,
        uint256 indexed tokenId,
        address owner
    );

    /**
     * Always returns `IERC721Receiver.onERC721Received.selector`.
     */
    function onERC721Received(
        address,
        address,
        uint256,
        bytes memory
    ) public virtual override returns (bytes4) {
        return this.onERC721Received.selector;
    }

    function onERC1155Received(
        address,
        address,
        uint256,
        uint256,
        bytes calldata
    ) external pure override returns (bytes4) {
        return
            bytes4(
                keccak256(
                    "onERC1155Received(address,address,uint256,uint256,bytes)"
                )
            );
    }

    function onERC1155BatchReceived(
        address,
        address,
        uint256[] calldata,
        uint256[] calldata,
        bytes calldata
    ) external pure override returns (bytes4) {
        return
            bytes4(
                keccak256(
                    "onERC1155BatchReceived(address,address,uint256[],uint256[],bytes)"
                )
            );
    }

    function setCrownContract(address _newAddress)
        external
        onlyOwnerOf(_owner)
    {
        CrownNFTContract = ICrownNFT(_newAddress);
    }

    function setScepterContract(address _newAddress)
        external
        onlyOwnerOf(_owner)
    {
        ScepterNFTContract = IScepterNFT(_newAddress);
    }

    function setDAOTreasuryWallet(address _newAddress)
        external
        onlyOwnerOf(address(_owner))
    {
        _DAOTreasury = _newAddress;
    }

    /*
     @param
     tokenId: token id
     price: BNB,
     quantity: s lng
     nftType:  0 l scepter, 1 l crown
    */
    function createMarketItem(
        uint256 tokenId,
        uint256 price,
        uint256 quantity,
        uint8 nftType
    ) external {
        // validate price
        require(price > 0, "Price must be at least 1 wei");

        if (nftType == 0) {
            // scepter minimum quantity 100
            require(
                quantity >= 100,
                "Scepter quantity must be at least 100 item."
            );
            require(
                ScepterNFTContract.balanceOf(msg.sender, 0) >= quantity,
                "User not have enough SCEPTER"
            );
            ScepterNFTContract.safeTransferFrom(
                msg.sender,
                address(this),
                0,
                quantity,
                ""
            );
        } else {
            CrownNFTContract.transferFrom(msg.sender, address(this), tokenId);
        }

        _itemIds.increment();
        uint256 itemId = _itemIds.current();
        idToMarketItem[itemId] = MarketItem(
            itemId,
            tokenId,
            payable(msg.sender),
            quantity * price,
            quantity
        );

        emit MarketItemCreated(
            itemId,
            tokenId,
            msg.sender,
            quantity * price,
            quantity
        );
    }

    function buyMarketItem(uint256 itemIndex) public payable {
        require(
            idToMarketItem[itemIndex].seller != msg.sender,
            "Can not buy your item"
        );
        uint256 totalPrice = idToMarketItem[itemIndex].price;
        require(
            msg.value >= totalPrice,
            "Please submit the asking price in order to complete the purchase"
        );
        // sell successfully => tax sell 5% of market item's price
        uint256 taxSell = (totalPrice * 5) / 100;
        uint256 quantity = idToMarketItem[itemIndex].quantity; // quantity >= 100 => scepter nft, else crown nft
        uint256 tokenId = idToMarketItem[itemIndex].tokenId;
        // send BNB to seller
        (bool sent, ) = payable(idToMarketItem[itemIndex].seller).call{
            value: totalPrice - taxSell
        }("");
        require(sent, "Transfer BNB to seller failed");
        // send tax sell to DAO treasury
        (bool sentTx, ) = payable(_DAOTreasury).call{value: taxSell}(""); // transfer BNB
        require(sentTx, "Transfer BNB to DAO Treasury failed");
        // transfer market item to buyer
        if (quantity > 1) {
            ScepterNFTContract.safeTransferFrom(
                address(this),
                msg.sender,
                tokenId,
                quantity,
                ""
            );
        } else {
            CrownNFTContract.transferFrom(address(this), msg.sender, tokenId);
        }
        // remove market item
        emit BuyMarketItem(
            idToMarketItem[itemIndex].itemId,
            tokenId,
            quantity,
            totalPrice,
            idToMarketItem[itemIndex].seller,
            msg.sender
        );
        delete idToMarketItem[itemIndex];
    }

    function withdrawNFT(uint256 itemId)
        external
        onlyOwnerOf(idToMarketItem[itemId].seller)
    {
        MarketItem memory item = idToMarketItem[itemId];
        delete idToMarketItem[itemId];
        if (item.quantity > 1) {
            // quantity > 1 => scepter
            ScepterNFTContract.safeTransferFrom(
                address(this),
                msg.sender,
                0,
                item.quantity,
                ""
            );
        } else {
            CrownNFTContract.transferFrom(
                address(this),
                msg.sender,
                item.tokenId
            );
        }
        emit WithdrawItem(item.itemId, item.tokenId, item.seller);
    }

    /**
     * @dev Transfers ownership of the contract to a new account (`newOwner`).
     * Can only be called by the current owner.
     */
    function transferOwnership(address newOwner)
        public
        virtual
        onlyOwnerOf(_owner)
    {
        require(
            newOwner != address(0),
            "Ownable: new owner is the zero address"
        );
        _transferOwnership(newOwner);
    }

    /**
     * @dev Transfers ownership of the contract to a new account (`newOwner`).
     * Internal function without access restriction.
     */
    function _transferOwnership(address newOwner) internal virtual {
        _owner = newOwner;
    }

    modifier onlyOwnerOf(address _ownerAddress) {
        require(msg.sender == _ownerAddress, "Ownable: Not owner");
        _;
    }
}
